import kimetsu from './kimetsu.png'

export default function Header() {
  return (
    <div>
    <div className="bg-local">
      <img src={kimetsu} alt="kimetsu no yaiba" className=" h-[1080px] w-screen bg-gradient-to-r from-black to-transparent"/>
      <div className="absolute h-[1080px] w-screen bg-gradient-to-r from-black to-transparent"></div>
    </div>
    </div>
  )
}
